// import React from "react";
import { createGlobalStyle } from 'styled-components';

import Notable from "../Assets/Fonts/Notable-Regular.woff"
import Padauk_B from "../Assets/Fonts/Padauk-Bold.woff"
import Padauk_R from "../Assets/Fonts/Padauk-Regular.woff"

export default createGlobalStyle`
    @font-face {
        font-family: 'Font Name';
        src: local('Font Name'), local('FontName'),
        url(${Notable}) format('woff'),
        url(${Padauk_B}) format('woff');
        url(${Padauk_R}) format('woff');
        font-weight: 300;
        font-style: normal;
    }
`;
